La catedral Sainte-Marie de Auch (clasificada Patrimonio de la Humanidad por la UNESCO) es uno de los principales parajes en el camino de Santiago de Compostela. Fue construida en el emplazamiento de una antigua iglesia románica del siglo 11 en 1489. Es la iglesia más reciente de Francia y la más amplia (100 m de largo y 40 m de ancho) y una de las más ricas.
200 años fueron necesarios para construir esta iglesia, lo que explica la gran variedad de estilos (aunque la arquitectura sea de estilo gótico flamígero para el conjunto de la obra). A ambos lados de la fachada de estilo Renacimiento, hay 2 torres de 44 m cuyas dimensiones sorprenden.
Dentro, es una gran catedral con muchos tesoros. Tiene todo el tiempo necesario para descubrirlos. Tres elementos notables:
• las vidrieras del siglo 16, obra de Arnaud de Moles, que forman parte de las vidrieras más bonitas del siglo 16;
• el coro de madera de roble, compuesto de caballerizas altas y de caballerizas bajas donde más de 1500 personajes esculpidos representan un conjunto iconográfico de una riqueza incomparable;
• la deposición del cuerpo de Cristo, atribuida a Arnaud Moles, data del siglo 16.
